import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import { FaFacebook, FaTwitter, FaInstagram, FaLinkedin, FaGithub } from 'react-icons/fa';

const FooterContainer = styled.footer`
  background-color: #2c3e50;
  color: #ecf0f1;
  padding: 60px 0 20px;
`;

const FooterContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  gap: 30px;
  
  @media (max-width: 992px) {
    grid-template-columns: repeat(2, 1fr);
  }
  
  @media (max-width: 576px) {
    grid-template-columns: 1fr;
  }
`;

const FooterColumn = styled.div`
  h3 {
    color: #e74c3c;
    margin-bottom: 20px;
    font-size: 1.2rem;
  }
  
  ul {
    list-style: none;
    padding: 0;
    margin: 0;
  }
  
  li {
    margin-bottom: 10px;
  }
  
  a {
    color: #ecf0f1;
    text-decoration: none;
    transition: all 0.3s ease;
    
    &:hover {
      color: #e74c3c;
    }
  }
`;

const SocialLinks = styled.div`
  display: flex;
  margin-top: 20px;
  
  a {
    display: flex;
    align-items: center;
    justify-content: center;
    width: 40px;
    height: 40px;
    background-color: rgba(255, 255, 255, 0.1);
    border-radius: 50%;
    margin-right: 10px;
    transition: all 0.3s ease;
    
    &:hover {
      background-color: #e74c3c;
      transform: translateY(-3px);
    }
  }
`;

const Copyright = styled.div`
  text-align: center;
  margin-top: 40px;
  padding-top: 20px;
  border-top: 1px solid rgba(255, 255, 255, 0.1);
  
  p {
    color: rgba(255, 255, 255, 0.6);
    font-size: 0.9rem;
  }
`;

const Footer = () => {
  return (
    <FooterContainer>
      <FooterContent>
        <FooterColumn>
          <h3>MindMentor</h3>
          <p>An all-in-one AI-powered solution designed to support students' academic performance and mental wellness.</p>
          <SocialLinks>
            <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">
              <FaFacebook />
            </a>
            <a href="https://twitter.com" target="_blank" rel="noopener noreferrer">
              <FaTwitter />
            </a>
            <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
              <FaInstagram />
            </a>
            <a href="https://linkedin.com" target="_blank" rel="noopener noreferrer">
              <FaLinkedin />
            </a>
            <a href="https://github.com" target="_blank" rel="noopener noreferrer">
              <FaGithub />
            </a>
          </SocialLinks>
        </FooterColumn>
        
        <FooterColumn>
          <h3>Quick Links</h3>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/#about">About</Link></li>
            <li><Link to="/#features">Features</Link></li>
            <li><Link to="/#package-list">Pricing</Link></li>
            <li><Link to="/download">Download</Link></li>
          </ul>
        </FooterColumn>
        
        <FooterColumn>
          <h3>Features</h3>
          <ul>
            <li><Link to="/#features">Academic Performance Predictor</Link></li>
            <li><Link to="/#features">Smart Mental Health Triage</Link></li>
            <li><Link to="/#features">Emotion & Behavior Monitoring</Link></li>
            <li><Link to="/#features">AI-Powered Music Recommender</Link></li>
            <li><Link to="/#features">Insightful Dashboards</Link></li>
          </ul>
        </FooterColumn>
        
        <FooterColumn>
          <h3>Contact Us</h3>
          <ul>
            <li>Email: info@mindmentor.com</li>
            <li>Phone: +1 (123) 456-7890</li>
            <li>Address: 123 AI Avenue, Tech City, TC 12345</li>
          </ul>
        </FooterColumn>
      </FooterContent>
      
      <Copyright>
        <p>© {new Date().getFullYear()} MindMentor. All Rights Reserved.</p>
      </Copyright>
    </FooterContainer>
  );
};

export default Footer;
